import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';
import {getAllStudents} from './client';

function App() {
  return (
    getAllStudents().then(response => response.json())
    .then(data => {
      console.log(data)
    })
  );
}

export default App;
